    const { getPokemons, currents, newsl } = useContext(PokemonContext);
    
    useEffect(() => {
        getPokemons().catch(null);
    }, []);

    //console.log("entro");
    //console.log(pokemons);

    return(
        <div>
           <PokemonList currents={currents} news={newsl}/>
        </div>
    );
}
